import logo from './logo.svg';
import './App.css';
import  {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import React from 'react';
import LoginPage from './components/HomePage';

function App() {
  return (
<Router>
  <Routes>
    <Route path="/" element={<LoginPage />} />
  </Routes>
</Router>
  );

}

export default App;
